	add("heptameride", "{\"term\":\"heptameride\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027heptaméride\u0027 from Ancient greek (to 1453) \u0027ἑπτά\u0027 (seven) + French \u0027méride\u0027 (compare meridian).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thing having seven parts or divisions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1914\u0027\u0027, \u0027The Saturday Evening Post\u0027, vol. 186, iss. 4, page 45\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Greeks had Seven Wise Men and Seven Sleepers, and the Pythagoreans saw magic in all the \u0027\u0027heptamerides\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A seven-unit oligomer\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1930\u0027\u0027, \u0027British Chemical Abstracts: Part A, Pure Chemistry\u0027, page 317, [http://www.worldcat.org/search?q\u003dn2%3A0365-9259 ISSN 0365-9259\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The residue remaining after the separation of the \u0027\u0027heptameride\u0027\u0027 is colourless and very viscous; there appears little prospect of isolating higher polymerides\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1938\u0027\u0027, Albert Ernest Dunstan, Benjamin Talbott Brooks (eds), \u0027The Science of Petroleum\u0027, vol. 4, page 2830, [http://www.worldcat.org/oclc/313182716 OCLC 313182716\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Fractionation of the liquid polymers gave compounds up to the \u0027\u0027heptameride\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1939\u0027\u0027, \u0027British Chemical Abstracts: Part A, Pure Chemistry\u0027, page 602, [http://www.worldcat.org/search?q\u003dn2%3A0365-9259 ISSN 0365-9259\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"From available v.d. data the existence of polymerides is shown and the relative amounts of various associated forms up to the \u0027\u0027heptameride\u0027\u0027 have been calc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An interval of pitch equal to 1/7 of a meride, or 1/301 of an octave\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, Joseph Sauveur (trans. Rudolf Rasch), \u0027Collected Writings on Musical Acoustics: (Paris 1700-1713)\u0027, page 28, ISBN 9070907089\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Sauveur divided the \u0027\u0027heptameride\u0027\u0027 into two demi-\u0027\u0027heptamerides\u0027\u0027. One demi-\u0027\u0027heptameride\u0027\u0027 is 1/602 of an octave, with frequency ratio 1:2\u0026lt;sup\u0026gt;1/602\u0026lt;/sup\u0026gt; \u003d 1.001 154 or 1.993 cents, very nearly 1/12 of a ditonic comma\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Translator\u0027s notes in: w:Hermann von Hermann von Helmholtz, \u0027On the Sensations of Tone\u0027, page 437, ISBN 1602066396\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"As 301 \u003d 7 \u0026amp;times; 43, he called each degree a \u0027\u0027heptameride\u0027\u0027, which he made \u003d .03987 of an (equal) Semitone\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Patrizio Barbieri, \u0027Enharmonic: Instruments and Music 1470-1900\u0027, page 378, ISBN 8895203143\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Sauveur stresses that the difference between the pure 5th (176 \u0027\u0027\u0027heptamerides\u0027\u0027\u0027) and the tempered 5th (175) is equal to 1: so the temperaments of all the other intervals will also be multiples of 1\", \"priority\":17}]}, \"synonyms\":{}}");

